import React from "react";
import { Flex, Image, Box } from "@chakra-ui/react";
import logo from "../assets/logo.png";

const NavBar = () => {
    return(
        <>
        <Box>
            <Flex as='nav' bg='tomato' gap="10" justifyContent="space-between" position="fixed">
                <Box>
                    <Image src={logo} alt="solo mina corp"></Image>
                </Box>
            </Flex>
        </Box>
       
        </>
    )
};

export default NavBar;
